import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <span>Fortnite Clicky Game</span>
      <img class="React" src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/512px-React-icon.svg.png"></img>
    </footer>
  );
}

export default Footer;
